    private bool TryFormat_If_CrLf(ref uint tokenIndex, ref FormatterContext context, int spaces)
    {
        if (!TryFormat_Condition_CrLf(ref tokenIndex, ref context, spaces))
        {
            return false;
        }

        if (!TryFormat_Block_CrLf(ref tokenIndex, ref context, spaces + 4))
        {
            return false;
        }

        if (++tokenIndex + 1 >= TokenList.Count || TokenList[tokenIndex].Kind != TokenKind.Else)
        {
            --tokenIndex;
            return true;
        }

        if (!FillSpaces(ref context, spaces))
        {
            return false;
        }

        switch (TokenList[++tokenIndex].Kind)
        {
            case TokenKind.@if:
                if (!Try_Else_If(ref context))
                {
                    return false;
                }

                return TryFormat_If_CrLf(ref tokenIndex, ref context, spaces);
            case TokenKind.rif:
                if (!Try_Else_Rif(ref context))
                {
                    return false;
                }
                
                return TryFormat_If_CrLf(ref tokenIndex, ref context, spaces);
            case TokenKind.BracketLeft:
                if (!Try_Else_CrLf(ref context))
                {
                    return false;
                }
                
                if (!FillSpaces(ref context, spaces))
                {
                    return false;
                }

                if (!Try_BracketLeft_CrLf(ref context))
                {
                    return false;
                }

                return TryFormat_Block_CrLf(ref tokenIndex, ref context, spaces + 4);
            default:
                context.FormatFail = true;
                return false;
        }
    }

