    private bool TryFormatElementAssignment_Lf_Not_DEFAULT(ref Token element, ref uint tokenIndex, ref FormatterContext context)
    {
        if (!TryFormatElementAssignment_Lf_DEFAULT(ref element, ref tokenIndex, ref context))
        {
            return false;
        }

        do
        {
            if (++tokenIndex >= TokenList.Count)
            {
                context.FormatFail = true;
                return false;
            }

            ref var token = ref TokenList[tokenIndex];
            switch (token.Kind)
            {
                case TokenKind.Content:
                    if (token.IsFirstTokenInTheLine)
                    {
                        if (!"\n        ".TryCopyTo(context.Destination))
                        {
                            return false;
                        }

                        context.Destination = context.Destination.Slice(9);
                        context.Written += 9;
                        context.JustChangeLine = false;
                    }

                    if (TryCopy_Lf(ref token.Range, ref context))
                    {
                        continue;
                    }

                    return false;
                case TokenKind.Mul:
                    if (!" * ".TryCopyTo(context.Destination))
                    {
                        return false;
                    }

                    context.Destination = context.Destination.Slice(3);
                    context.Written += 3;
                    context.JustChangeLine = false;
                    continue;
                case TokenKind.Semicolon:
                    if (token.IsFirstTokenInTheLine)
                    {
                        if (context.JustChangeLine)
                        {
                            if (context.Destination.Length < 4)
                            {
                                return false;
                            }
                            context.Destination.Slice(0, 4).Fill(' ');
                            context.Destination = context.Destination.Slice(4);
                            context.Written += 4;
                        }
                        else
                        {
                            if (!"\n    ".TryCopyTo(context.Destination))
                            {
                                return false;
                            }
                            context.Destination = context.Destination.Slice(5);
                            context.Written += 5;
                        }   
                        context.JustChangeLine = false;
                    }
                    return Try_Semicolon(ref context);
                case TokenKind.Comma:
                    if (tokenIndex + 1 < TokenList.Count && TokenList[tokenIndex + 1].IsFirstTokenInTheLine)
                    {
                        if (!Try_Comma(ref context))
                        {
                            return false;
                        }
                    }
                    else
                    {
                        if (!Try_Comma_Space(ref context))
                        {
                            return false;
                        }
                    }

                    continue;
                default:
                    --tokenIndex;
                    return true;
            }
        } while (true);
    }

    private bool TryFormatElementAssignment_Lf_Not_DEFAULT(ref Token element, ref uint tokenIndex, ref FormatterContext context, int spaces)
    {
        if (!TryFormatElementAssignment_Lf_DEFAULT(ref element, ref tokenIndex, ref context, spaces))
        {
            return false;
        }

        do
        {
            if (++tokenIndex >= TokenList.Count)
            {
                context.FormatFail = true;
                return false;
            }

            ref var token = ref TokenList[tokenIndex];
            switch (token.Kind)
            {
                case TokenKind.Content:
                    if (token.IsFirstTokenInTheLine)
                    {
                        if (!Try_Lf(ref context))
                        {
                            return false;
                        }

                        if (!FillSpaces(ref context, spaces + 4))
                        {
                            return false;
                        }
                    }

                    if (TryCopy_Lf(ref token.Range, ref context))
                    {
                        continue;
                    }

                    return false;
                case TokenKind.Mul:
                    if (!" * ".TryCopyTo(context.Destination))
                    {
                        return false;
                    }

                    context.Destination = context.Destination.Slice(3);
                    context.Written += 3;
                    context.JustChangeLine = false;
                    continue;
                case TokenKind.Semicolon:
                    if (token.IsFirstTokenInTheLine)
                    {
                        if (!context.JustChangeLine)
                        {
                            if (!Try_Lf(ref context))
                            {
                                return false;
                            }
                        }

                        if (!FillSpaces(ref context, spaces))
                        {
                            return false;
                        }
                    }

                    return Try_Semicolon(ref context);
                case TokenKind.Comma:
                    if (tokenIndex + 1 < TokenList.Count && TokenList[tokenIndex + 1].IsFirstTokenInTheLine)
                    {
                        if (!Try_Comma(ref context))
                        {
                            return false;
                        }
