                    else
                    {
                        if (!Try_Comma_Space(ref context))
                        {
                            return false;
                        }
                    }

                    continue;
                default:
                    --tokenIndex;
                    return true;
            }
        } while (true);
    }

    private bool TryFormatElementAssignment_Lf_DEFAULT(ref Token element, ref uint tokenIndex, ref FormatterContext context)
    {
        if (++tokenIndex + 1 >= TokenList.Count || TokenList[tokenIndex].Kind != TokenKind.Assign)
        {
            context.FormatFail = true;
            return false;
        }

        ref var content = ref TokenList[++tokenIndex];
        if (content.Kind != TokenKind.Content)
        {
            context.FormatFail = true;
            return false;
        }

        if (element.IsFirstTokenInTheLine && context.JustChangeLine)
        {
            if (context.Destination.Length < 4)
            {
                return false;
            }
            context.Destination.Slice(0, 4).Fill(' ');
            context.Destination = context.Destination.Slice(4);
            context.Written += 4;
        }
        else
        {
            if (!"\n    ".TryCopyTo(context.Destination))
            {
                return false;
            }
            context.Destination = context.Destination.Slice(5);
            context.Written += 5;
        }
        
        context.JustChangeLine = false;
        if (!TryCopy_Lf(ref element.Range, ref context))
        {
            return false;
        }

        if (content.IsFirstTokenInTheLine)
        {
            if (!Try_Space_Assign_Lf_Tab2(ref context))
            {
                return false;
            }
        }
        else
        {
            if (!" = ".TryCopyTo(context.Destination))
            {
                return false;
            }

            context.Destination = context.Destination.Slice(3);
            context.Written += 3;
            context.JustChangeLine = false;
        }

        return TryCopy_Lf(ref content.Range, ref context);
    }

    private bool TryFormatElementAssignment_Lf_DEFAULT(ref Token element, ref uint tokenIndex, ref FormatterContext context, int spaces)
    {
        if (++tokenIndex + 1 >= TokenList.Count || TokenList[tokenIndex].Kind != TokenKind.Assign)
        {
            context.FormatFail = true;
            return false;
        }

        ref var content = ref TokenList[++tokenIndex];
        if (content.Kind != TokenKind.Content)
        {
            context.FormatFail = true;
            return false;
        }

        if ((!element.IsFirstTokenInTheLine || !context.JustChangeLine) && !Try_Lf(ref context))
        {
            return false;
        }

        if (!FillSpaces(ref context, spaces))
        {
            return false;
        }

        if (!TryCopy_Lf(ref element.Range, ref context))
        {
            return false;
        }

        if (content.IsFirstTokenInTheLine)
        {
            if (!Try_Space_Assign_Lf(ref context))
            {
                return false;
            }

            if (!FillSpaces(ref context, spaces + 4))
            {
                return false;
            }
        }
        else
        {
            if (!" = ".TryCopyTo(context.Destination))
            {
                return false;
            }

            context.Destination = context.Destination.Slice(3);
            context.Written += 3;
            context.JustChangeLine = false;
        }

        return TryCopy_Lf(ref content.Range, ref context);
    }

    private bool TryFormatCallActionArguments_Lf(ref uint tokenIndex, ref FormatterContext context, int spaces)
    {
        do
        {
            if (++tokenIndex >= TokenList.Count)
            {
                context.FormatFail = true;
                return false;
            }

            ref var token = ref TokenList[tokenIndex];
            switch (token.Kind)
            {
                case TokenKind.Content:
                    if (token.IsFirstTokenInTheLine && !Try_Lf(ref context) && !FillSpaces(ref context, spaces + 4))
                    {
                        return false;
                    }

                    if (TryCopy_Lf(ref token.Range, ref context))
                    {
                        continue;
                    }

                    return false;
                case TokenKind.Comma:
                    if (tokenIndex + 1 < TokenList.Count && TokenList[tokenIndex + 1].IsFirstTokenInTheLine)
                    {
                        if (!Try_Comma(ref context))
                        {
                            return false;
                        }
                    }
                    else
                    {
                        if (!Try_Comma_Space(ref context))
                        {
                            return false;
                        }
                    }

                    continue;
                case TokenKind.ParenRight:
                    return Try_ParenRight_Lf(ref context);
                default:
                    --tokenIndex;
                    return true;
            }
        } while (true);
    }

